	      var prefabObject = this.getPrefabObject();
	      var prefabComponents = prefabObject.get('components');
	      var myComponents = this.get('components');
	      if (!myComponents) {
	        myComponents = {};
	      }
	      var changes = {
	        components: {}
	      };
	      var removals = [];
	      //For new components coming from the prefab, add them to ours.
	      //For deleted components coming from the prefab, handle deleting them.
	      _.each(changedPrefabComponents, function(comp, id) {
	        if (!comp) {
	          if (myComponents[id]) {
	            //Only remove the component if it doesn't have any overridden parameters.
	            if (_.isEmpty(myComponents[id].componentData)) {
	              removals.push('components.' + id);
	            }
	          }
	          return;
	        }
	        if (!myComponents[id]) {
	          changes.components[id] = {
	            scriptId: prefabComponents[id].scriptId,
	            componentData: {}
	          };
	        }
	      }, this);
	      if (removals.length) {
	        _.each(removals, function(toRemove) {
	          this.unset(toRemove);
	        }, this);
	      }
	      if (!_.isEmpty(changes.components)) {
	        this.set(changes);
	      }
