	    Box3DEntity.prototype._determineScaleToSize = function(size) {
	      var aabb = {};
	      var bb = this.getBounds();
	      if (!bb) {
	        log.info('No bounds for ' + this.type + ' ' + this.id +
	          ' so we\'ll compute it from the heirarchy. This could be slow.');
	        bb = this.computeBounds();
	      }
	      aabb.min = new THREE.Vector3(bb.min.x, bb.min.y, bb.min.z);
	      aabb.max = new THREE.Vector3(bb.max.x, bb.max.y, bb.max.z);
	      // Determine the mesh's scale and origin.
	      var distance = aabb.min.distanceTo(aabb.max);
	      var scale = size / distance;
	      if (scale <= 0) {
	        scale = 1.0;
	      }
	      return scale;
	    };

	    /**
	     * Get the bounds for the hierarchy rooted at this object.
	     * @method getBounds
	     * @public
	     * @returns {THREE.Box3|null} The bounds of the hierarchy, in this
	     * object's local space, or null if the bounds have not been computed.
	     */
	    Box3DEntity.prototype.getBounds = function() {
	      // TODO: move this method to Box3DObject.
	      var bounds = this.getProperty('bounds');

	      if (bounds) {
	        return new THREE.Box3().set(
	          new THREE.Vector3(bounds.min.x, bounds.min.y, bounds.min.z),
	          new THREE.Vector3(bounds.max.x, bounds.max.y, bounds.max.z)
	        );
	      }

	      return null;
	    };

	    /**
	     * Get the bounds of this object, but not its children.
	     * @method getLocalBounds
	     * @public
	     * @returns {THREE.Box3} The bounds of this object.
	     */
	    Box3DEntity.prototype.getLocalBounds = function() {
	      // TODO: move this method to Box3DObject.
	      return new THREE.Box3();
	    };

	    /**
	     * Compute the bounds for the hierarchy rooted at this object.
	     * @method computeBounds
	     * @public
	     * @param {Object} options Options for setting the 'bounds' property.
	     * @returns {THREE.Box3} The bounds of the hierarchy, in this object's
	     * local space.
	     */
	    Box3DEntity.prototype.computeBounds = function(options) {
	      // TODO: move this method to Box3DObject.
	      var children = this.getChildren(),
	        box = this.getLocalBounds(),
	        xform = new THREE.Matrix4();

	      children.forEach(function(child) {
	        var childBox = child.computeBounds();

	        if (!childBox.empty()) {
	          // Transform the child's bounds into its parent's space.
	          xform.compose(child.getPosition(), child.getQuaternion(),
	            child.getScale());

	          childBox.applyMatrix4(xform);

	          // Combine the child box with the others.
	          box.union(childBox);
	        }
	      }, this);

	      this.setProperty('bounds', {
	        min: { x: box.min.x, y: box.min.y, z: box.min.z },
	        max: { x: box.max.x, y: box.max.y, z: box.max.z }
	      }, options);

	      return box;
	    };

	    Box3DEntity.prototype.getComponentData = function(componentId, attribute) {

	      var thisComponents = this.get('components');
	      var thisComponent = thisComponents[componentId];
	      if (thisComponent) {
	        var returnObj = {};
	        var prefabObj = this.getPrefabObject();
	        if (prefabObj) {

	          var prefabComponentData = prefabObj.getComponentData(componentId, attribute);
	          if (prefabComponentData) {
	            _.extend(returnObj, _.deepClone(prefabComponentData));
	          }
	        }
	        _.extend(returnObj, _.deepClone(thisComponent.componentData));
	        // TODO - re-enable this functionality when putting prefab logic back in.
	        // this._linkupComponentReferences(returnObj);
	        if (attribute) {
	          return returnObj[attribute];
	        } else {
	          return returnObj;
	        }
	      } else if (!componentId) {
	        var compData = {};
	        var comps = this.getComponents();
	        _.each(comps, function(comp, id) {
	          compData[id] = this.getComponentData(id);
	        }, this);
	        return compData;
	      } else {
	        return null;
	      }
	    };

	    Box3DEntity.prototype.getPreviousComponentData = function(componentId, attribute) {

	      var thisComponents = this.entityModel.previous('components');
	      var thisComponent = thisComponents[componentId];
	      if (thisComponent) {
	        var returnObj = {};

	        var prefabObj = this.getPrefabObject();
	        if (prefabObj) {
	          var prefabComponentData = prefabObj.getPreviousComponentData(componentId, attribute);
	          if (prefabComponentData) {
	            _.extend(returnObj, _.deepClone(prefabComponentData));
	          }
	        }
	        _.extend(returnObj, _.deepClone(thisComponent.componentData));
	        // TODO - re-enable this functionality when putting prefab logic back in.
	        // this._linkupComponentReferences(returnObj);
	        if (attribute) {
	          return returnObj[attribute];
	        } else {
	          return returnObj;
	        }
	      } else if (!componentId) {
	        var compData = {};
	        var comps = this.getComponents();
	        _.each(comps, function(comp, id) {
	          compData[id] = this.getPreviousComponentData(id);
	        }, this);
	        return compData;
	      } else {
	        return null;
	      }
	    };

	    /**
	     * Returns the first component found with the provided script Id
	     * @method getComponentByScriptId
	     * @param  {String} scriptId The asset Id of the script asset used by the components
	     * @return {Object} The first component matching the search.
	     */
	    Box3DEntity.prototype.getComponentByScriptId = function(scriptId) {
	      var comps = this.getComponents(function(comp) {
	        return comp.getScriptId() === scriptId;
	      });
	      if (_.isEmpty(comps)) {
	        return null;
	      } else {
	        return _.values(comps)[0];
	      }
	    };

